import React, { Component } from "react";
import { StyleSheet, View, Text } from "react-native";
import Icon from "react-native-vector-icons/Entypo";

function ActiveDropDownOption(props) {
  return (
    <View style={[styles.container, props.style]}>
      <Icon name="chevron-right" style={styles.chevronRight}></Icon>
      <Text style={styles.label}>Category Management</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    justifyContent: "space-between",
  },
  chevronRight: {
    color: "rgba(128,128,128,1)",
    fontSize: 20,
  },
  label: {
    fontWeight: "700",
    color: "#121212",
    fontSize: 15,
    width: 146,
    height: 34,
  },
});

export default ActiveDropDownOption;
